import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
// No longer need to import InsightMakerEmbed
// import InsightMakerEmbed from './InsightMakerEmbed';
import '../styles/GrowthSimulation.css'; // Make sure you have some basic CSS

const GrowthSimulation = () => {
  const navigate = useNavigate();
  // We still load the conditions to display them, but likely CANNOT pass them to the iframe
  const [displayConditions, setDisplayConditions] = useState({
      substrate: {},
      temperature: 0,
      ph: 0,
      yieldValue: 0,
      days: 40
  });

  useEffect(() => {
    // Load parameters from localStorage for display purposes
    const savedTemperature = localStorage.getItem('temperature');
    const savedPh = localStorage.getItem('ph');
    const savedSubstrateJson = localStorage.getItem('substrate');
    const savedYield = localStorage.getItem('yield');

    if (savedTemperature && savedPh && savedSubstrateJson) {
      try {
        const substrateData = JSON.parse(savedSubstrateJson);
        const temp = parseFloat(savedTemperature);
        const phValue = parseFloat(savedPh);
        const yieldVal = parseFloat(savedYield) || 0;

        // Store values primarily for display on this page
        setDisplayConditions({
            substrate: substrateData,
            temperature: temp,
            ph: phValue,
            yieldValue: yieldVal,
            days: 40 // Or adjust as needed
        });
        console.log("GrowthSimulation: Loaded display conditions from localStorage.");

      } catch (error) {
        console.error("GrowthSimulation: Error processing data from localStorage:", error);
        alert("Error loading simulation settings.");
        navigate('/condition-setting');
      }
    } else {
      console.error("GrowthSimulation: Required parameters not found in localStorage.");
      // Navigate back if data is missing, as the simulation won't use it anyway
      alert("Simulation parameters not set. Please configure them first.");
      navigate('/condition-setting');
    }
  }, [navigate]);

  const handleBackClick = () => {
    navigate('/condition-setting');
  };

  // This function saves data based on the INITIAL conditions from localStorage.
  // It does NOT reflect the results of the simulation embedded via iframe.
  const handleViewReportClick = () => {
    const formatDate = (date) => {
      const day = String(date.getDate()).padStart(2, '0');
      const month = String(date.getMonth() + 1).padStart(2, '0');
      const year = date.getFullYear();
      return `${day}/${month}/${year}`;
    };

    const newEntry = {
      days: displayConditions.days,
      yield: `${displayConditions.yieldValue}g`, // Yield from ConditionSetting page
      substrate: Object.entries(displayConditions.substrate)
        .map(([key, value]) => {
             const displayNames = { riceBran: 'Rice Bran', corn: 'Corn Cob', sugarcane: 'Sugarcane', sawdust: 'Sawdust' };
             return `${displayNames[key] || key}: ${value}g`;
        })
        .join(', '),
      conditions: `Temperature: ${displayConditions.temperature}°C, pH: ${displayConditions.ph}`,
      date: formatDate(new Date()),
    };

    try {
        const existingHistory = JSON.parse(localStorage.getItem('growthHistory')) || [];
        localStorage.setItem('growthHistory', JSON.stringify([...existingHistory, newEntry]));
        navigate('/'); // Navigate to the Growth Report page
    } catch (error) {
        console.error("Error saving growth history:", error);
        alert("Could not save growth history.");
    }
  };

  // Map substrate keys to display names
  const substrateDisplayNames = {
    riceBran: 'Rice Bran',
    corn: 'Corn Cob',
    sugarcane: 'Sugarcane',
    sawdust: 'Sawdust',
  };

  return (
    <div className="growth-simulation">
      <header className="simulation-header">
        <button className="back-button" onClick={handleBackClick}>
          ← Back to Settings
        </button>
        <h1>Mushroom Growth Simulation</h1>
      </header>
      <main className="simulation-content">
        {/* InsightMaker Simulation Embed */}
        <div className="simulation-container">
          {/*
             PASTE THE IFRAME SNIPPET FROM INSIGHTMAKER'S "EMBED IN WEBPAGE" HERE.
             Make sure to adjust attributes like width and height as needed.
             Example structure (replace with your actual snippet):
          */}
          <iframe src="https://insightmaker.com/insight/1JN05JByWKiPAmj9it5RIl/embed?topBar=1&sideBar=1&zoom=1" title="Embedded model" width="800" height="600"></iframe>
          {/* End of pasted iframe snippet */}

          <p style={{ fontSize: '0.8em', color: '#aaa', marginTop: '10px' }}>
            Note: This simulation runs with default parameters set in InsightMaker,
            not necessarily the conditions chosen on the previous screen.
          </p>
        </div>

        {/* Display Chosen Conditions (from previous screen) */}
        <div className="chosen-conditions">
          <h3>Conditions Chosen (for reference):</h3>
          <ul>
            {Object.entries(displayConditions.substrate).map(([key, value]) => (
              <li key={key}>
                {substrateDisplayNames[key] || key}: {value}g
              </li>
            ))}
            <li>Temperature: {displayConditions.temperature}°C</li>
            <li>pH: {displayConditions.ph}</li>
            <li>Target Yield: {displayConditions.yieldValue}g</li>
            <li>Simulation Duration: {displayConditions.days} days</li>
          </ul>
        </div>

        {/* Done Button */}
        <button className="view-report-button" onClick={handleViewReportClick}>
          Done
        </button>
      </main>
    </div>
  );
};

export default GrowthSimulation;
